/**
 * App components
 * 
 * Description.js:
 * 
 * Author: Truong Thinh
 * Create At: 5/ 8/ 2021
 */
import React from "react";

function Description(props) {
  return (
    <section className="container">
      <div className="has-text-centered content">
        <br />
        <h1 className="title is-4 is-uppercase has-text-info">Token Wallet</h1>
        <h2 className="subtitle is-6 has-text-black-light">
          ERC20Tokens & ERC721Tokens
        </h2>
      </div>
    </section>
  );
}

export default Description;
